import React from "react";
import "../Product.css"
import { Container, Row, Col } from "react-bootstrap";
const Documentation = () => {
    return (
        <>
            <Container className="body mb-0">
                <Row>
                    <Col md>
                        <img src="/images/LogisticsDocumentation.png" width="90%" height="90%" alt="invoiceimage"  />
                    </Col>
                    <Col md >
                        <div className="d-flex gap-4">
                            <img src="/images/Line5.png" alt="#" height="2px" style={{ marginTop: "2%" }} />
                            <h2 className="itxt6">LOGISTICS</h2>
                        </div>

                        <p className="itxt2 worksans">Documentation</p>
                        <p className="itxt3 aeonik" >Get access to all pre and post shipment documents.
                            Easily manage your shipments by accessing invoices and making payments directly on the platform.</p>
                        <button className="p-2 buttn aeonik">Check out <img src="/images/arrow-right.png" alt="arrow-right" width="45px" height="45px" className="icn"/></button>
                    </Col>
                </Row>
            </Container>
        </>
    );
};

export default Documentation;
